import React from "react";
import {
  StyledContainer, // Ensure this matches your styled-components export
  InnerContainer,
  PageLogo,
  PageTitle,
} from './../components/styles';

const Login = () => {
  return (
    <StyledContainer>
      <InnerContainer>
         <PageLogo resizeMode source={require('./../assets/img/img1.png')} />
      </InnerContainer>
    </StyledContainer>
  );
};

export default Login;
